svg.script:

                            function init(evt)
   {
                            if ( window.svgDocument == null )
   {
                            svgDocument = evt.target.ownerDocument;
							svgDocument.borderSplit = this.borderSplit;
   }
   }
                            function mouserOn(evt,elementname)
                            {
							var strname = elementname
							 document.getElementById(strname.concat("-AR")).setAttributeNS(null,"visibility",'visible');
							 document.getElementById(strname.concat("-Mexico")).setAttributeNS(null,"visibility",'visible');
							 document.getElementById(strname.concat("-NV")).setAttributeNS(null,"visibility",'visible');
							 document.getElementById(strname.concat("-circle")).setAttributeNS(null,"r",'30');
							 document.getElementById(strname.concat("-circle")).setAttributeNS(null,"fill",'#ff2500');
							 document.getElementById(strname.concat("-num")).setAttributeNS(null,"font-size","42");
							 document.getElementById(strname.concat("-paths")).setAttributeNS(null,"visibility",'visible');
							 document.getElementById(strname.concat("-level")).beginElement();

   }
                         function mouserOff(evt,elementname)
                         {
						var strname = elementname
						 document.getElementById(strname.concat("-AR")).setAttributeNS(null,"visibility",'hidden');
						 document.getElementById(strname.concat("-Mexico")).setAttributeNS(null,"visibility",'hidden');
						 document.getElementById(strname.concat("-NV")).setAttributeNS(null,"visibility",'hidden');
						 document.getElementById(strname.concat("-circle")).setAttributeNS(null,"r",'20');
						 document.getElementById(strname.concat("-num")).setAttributeNS(null,"font-size","30");
						 document.getElementById(strname.concat("-circle")).setAttributeNS(null,"fill",'#ffc966');
						 document.getElementById("normal-level").beginElement();
						 setTimeout(function(){document.getElementById(strname.concat("-paths")).setAttributeNS(null,"visibility",'hidden')},100);

}
						function borderSplit(){
          			  		document.getElementById("non-lo-CO-states").setAttributeNS(null,"visibility",'hidden')
							document.getElementById("move-California-out").beginElement();
							document.getElementById("move-Arizona-out").beginElement();
							document.getElementById("move-Nevada-out").beginElement();
							document.getElementById("move-Mexico-out").beginElement();
						setTimeout(function(){
							document.getElementById("Normal-allocation-blocks").setAttributeNS(null,"visibility",'hidden')
							document.getElementById("normal-allocation-CA").setAttributeNS(null,"visibility",'visible')
							document.getElementById("normal-allocation-NV").setAttributeNS(null,"visibility",'visible')
							document.getElementById("normal-allocation-AR").setAttributeNS(null,"visibility",'visible')
							document.getElementById("normal-allocation-Mexico").setAttributeNS(null,"visibility",'visible')
							document.getElementById("Mead-animation").setAttributeNS(null,"visibility",'visible')
							},2000);	
}
						function shortage2start(){
          			  		var ele = document.getElementById("shortage2start");
	          			  	ele.beginElement();
}
						function shortage2end(){
          			  		var ele = document.getElementById("shortage2end");
	          			  	ele.beginElement();
}
